export default {
  data() {
    return {
      carsNumber: []
    };
  },
  methods: {
    onKeyUp(e) {
      if (e.keyCode === 27 && !window.isModalShow) this.$callClient("C:CarNumber:Destroyed");
    },
    onClickButton(numberId, type) {
      this.$callClient("CarNumber.Moderation.Apply", numberId, type);
    },
    setData(data) {
      this.carsNumber = data;
    },
    onClick() {
      this.$callClient("C:CarNumber:Destroyed");
    }
  },
  created() {
    this.$onClient("W:CarNumber:SetData", this.setData);
    window.addEventListener("keyup", this.onKeyUp);
    this.$callClient("C:CarNumber:Ready");
  },
  beforeUnmount() {
    this.$offClient("W:CarNumber:SetData", this.setData);
    window.removeEventListener("keyup", this.onKeyUp);
  }
};
